import React from "react";

function CommentItem(props) {
  return (
    <li>
      <p>{props.commentData.name}</p>
      <p>{props.commentData.timestamp}</p>
      <p>{props.commentData.comment}</p>
    </li>
  );
}

export default CommentItem;
